import { connect } from "react-redux";

const DisplayToDos = props => {
  const todo = props.savedValues
    ? props.savedValues.map(x => {
        const todoMap = x;
        return (
          <li onClick={() => handleDelete(x)} key={x}>
            {x}
          </li>
        );
      })
    : null;

  const handleDelete = key => {};
  return <ul>{todo}</ul>;
};
const mapStateToProps = state => {
  return {
    savedValues: state.savedValues
  };
};

export default connect(mapStateToProps)(DisplayToDos);
